          <TextField
            variant="standard"
            placeholder="search"
            inputProps={{
              endAdornment: (
                <InputAdornment position="end">
                  <SearchIcon
                    sx={{ zIndex: 100, color: "blue", fontSize: "40px" }}
                  />
                </InputAdornment>
              ),
            }}
          ></TextField>
        </Toolbar> */}

        <Toolbar sx={{ bgcolor: "white" }}>
          <Typography variant="h5" sx={{ color: "#42a5f5" }} fontWeight="bold">
            FriendSphere
          </Typography>
          <TextField
          id="input-with-icon-adornment"
          label="Username"
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon />
              </InputAdornment>
            ),
          }}
        />
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Navbar;
